import React from 'react';

function RoundedTextBox(props) {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <input
        type="text"
        style={{
          borderRadius: '10px',
          borderBlockColor: 'blue',
          borderInlineColor: 'blue',
          height: '100px',
          width: '500px',
          padding: '10px',
          border: '1px solid gray',
        }}
        {...props}
      />
    </div>
  );
}

function Header({args}){
  const mystyle = {
    color: args.color,
    textAlign: "center",
    fontSize: args.size
  };
  return(
    <div>
      <h1 style={mystyle}>{args.text}</h1>
    </div>
  );
}

function App(){
  return (
    <div>
      <Header args={{text: "AI Detector",
                     color: "green",
                     size: "50px"}}/>
      <Header args={{text: "IE3 Team ?",
                     color: "black",
                     size: "20px"}}/>               
      <RoundedTextBox placeholder="Insert text"/>
    </div>
  );
}

export default App;
